import React from "react";

function Pessoa(nome,idade,foto,proficao){
    return (
        <div>
            <img src={props.foto} alt="props.nome"/>
            <h2>Nome: {props.nome}</h2>
            <p>idade: {props.idade}</p>
            <p>Proficao: {props.proficao}</p>
        </div>
    )
}

export default Pessoa
